import { enumStatus, enumUnit } from "@configs";

export interface ICoupon {
    _id?: string;
    name: string;
    code?: string;
    levelIds: Array<string> | undefined;
    status: enumStatus;
    qrToken: string;
    quantity: number;
    limit: number;
    imageUrl: Array<string>;
    guideline?: string;
    startDate: Date | string;
    endDate: Date | string;
    qrImageLink: string;
    benefit: number;
    unit?: enumUnit | string;
}

export interface IReceive {
    objectId: string;
    type: "COUPON";
    status: "ACTIVE";
}

export interface ICouponList {
    merchantId:string;
    objectId:string;
    userId:string;
    qrtable:ICoupon;
}
